INSERT OR IGNORE INTO drug_interactions (id, ingredient1, ingredient2, severity, effect, source, management_text, mechanism_text, recommendation, risk_level, type, metabolism_info, source_url, reference_text, alternatives_a, alternatives_b, updated_at) VALUES (83017, 'Etelcalcetide', 'Denosumab', 'Major', 'Concomitant use of etelcalcetide with other medicines known to lower serum calcium may increase the risk of hypocalcemia. The proposed mechanism is additive reduction in serum calcium levels. Significant decreases in serum calcium may cause paraesthesias, myalgias, muscle spasms, seizures, QT interval prolongation, and ventricular arrhythmia. Etelcalcetide given alone may lead to severe hypocalcemia requiring concomitant treatment with therapies to increase serum calcium levels.', 'DDInter', 'Close monitoring of corrected serum calcium levels is recommended if etelcalcetide is used in combination with other medications known to lower serum calcium, such as denosumab, calcitonin, foscarnet, bisphosphonates, or loop diuretics. It is recommended that the patient''s corrected serum calcium level should be measured within one week of initiation or dose adjustment of etelcalcetide and monitored approximately every 4 weeks. In addition, the manufacturer product labeling should be consulted for management guidelines in the event of a reduction in corrected serum calcium levels below the lower limit of the normal range and/or symptoms of hypocalcemia. Patients should also be advised to contact their health care professional if they experience symptoms of hypocalcemia, such as numbness or tingling in the fingers, toes, or around the mouth, muscle spasms, twitches or cramps, seizures, confusion, and irregular heartbeats.', 'Synergism', 'Close monitoring of corrected serum calcium levels is recommended if etelcalcetide is used in combination with other medications known to lower serum calcium, such as denosumab, calcitonin, foscarnet, bisphosphonates, or loop diuretics.', 'Major', 'pharmacodynamic', NULL, 'https://ddinter2.scbdd.com/server/interact/83118/', '', 'Cholecalciferol, Vosoritide', 'Paricalcitol, Doxercalciferol, Salmon calcitonin, Calcifediol', 1767369485);
INSERT OR IGNORE INTO drug_interactions (id, ingredient1, ingredient2, severity, effect, source, management_text, mechanism_text, recommendation, risk_level, type, metabolism_info, source_url, reference_text, alternatives_a, alternatives_b, updated_at) VALUES (83018, 'Etidronic acid', 'Denosumab', 'Moderate', 'Osteonecrosis of the jaw (ONJ) has been reported with the use of angiogenesis inhibitors including denosumab, bevacizumab, and sunitinib. Concomitant exposure with other risk factors such as bisphosphonates (potency, route of administration, and cumulative dose), cancer, chemotherapy, corticosteroids, radiotherapy to the head and neck, dental disease, invasive dental procedures, or poor oral hygiene may increase the risk. Most reported cases with bevacizumab have occurred in patients who received prior or concomitant treatment with intravenous bisphosphonates or had a history of dental disease requiring invasive dental procedures.', 'DDInter', 'Caution is advised if bisphosphonates are used simultaneously or sequentially with denosumab or bevacizumab. Prior to initiating treatment, a thorough dental examination and appropriate preventive dentistry should be considered. If possible, invasive dental procedures should be avoided in patients who have previously received or are receiving intravenous bisphosphonates. Good oral hygiene practices should be maintained during treatment. Patients should be advised to seek medical attention if they experience signs and symptoms of osteonecrosis in the jaw, such as: pain in the mouth, teeth, or jaw, swelling or sores inside the mouth, numbness or a feeling of heaviness in the jaw, loosening of a tooth, or exposure of bone in the jaw. Temporary interruption of treatment should be considered if clinically appropriate, until the condition resolves.', 'Synergism', 'Caution is advised if bisphosphonates are used simultaneously or sequentially with denosumab or bevacizumab.', 'Moderate', 'pharmacodynamic', NULL, 'https://ddinter2.scbdd.com/server/interact/83119/', '', 'Cholecalciferol, Vosoritide, Denosumab, Burosumab', 'Tiludronic acid, Vosoritide, Etidronic acid, Ibandronate, Cholecalciferol, Burosumab, Zoledronic acid', 1767369485);
INSERT OR IGNORE INTO drug_interactions (id, ingredient1, ingredient2, severity, effect, source, management_text, mechanism_text, recommendation, risk_level, type, metabolism_info, source_url, reference_text, alternatives_a, alternatives_b, updated_at) VALUES (83019, 'Etoposide', 'Denosumab', 'Moderate', 'Concomitant use of immunosuppressive or myelosuppressive agents with denosumab may increase the risk of serious infections. Denosumab binds to and inhibits the receptor activator of nuclear factor kappa-B ligand (RANKL), which is expressed on activated T and B lymphocytes and in lymph nodes. Thus, denosumab alone may increase the risk of infections.', 'DDInter', 'Caution is advised if denosumab must be used in combination with immuno- or myelosuppressive agents. Patients should be advised to contact their physician if they develop signs and symptoms of infection such as fever, chills, diarrhea, sore throat, muscle aches, shortness of breath, blood in phlegm, weight loss, red or inflamed skin, body sores, and pain or burning during urination. The need for continued denosumab therapy should be assessed when serious infections occur during treatment.', 'Synergism', 'Caution is advised if denosumab must be used in combination with immuno- or myelosuppressive agents.', 'Moderate', 'pharmacodynamic', NULL, 'https://ddinter2.scbdd.com/server/interact/83120/', '', 'Tiludronic acid, Vosoritide, Etidronic acid, Ibandronate, Cholecalciferol, Burosumab, Risedronic acid, Romosozumab', '', 1767369485);
